import React from "react";

const Dots = ({ slides, activeSlide }: any) => (
  <div
    style={{
      position: "relative",
      bottom: "10px",
      width: "100%",
      display: "flex",
      alignItems: "center",
      justifyContent: "center",
    }}
  >
    {slides.map((slide: any, i: any) => (
      <span
        key={slide}
        style={{
          padding: "10px",
          marginRight: "5px",
          cursor: "pointer",
          borderRadius: "50%",
          background: ` ${activeSlide === i ? "black" : "white"}`,
        }}
      >
        {" "}
      </span>
    ))}
  </div>
);

export default Dots;
